                    </p>
                    <p class=""text-justify"">
                        SISTEMA TUFACTORING (o Sistema): Corresponde a un Desarrollo Tecnológico que permite al CLIENTE, a través del uso de los canales de banca por internet, realizar operaciones de registro, venta, compra, ordenar el pago o ceder Facturas de sus PROVEEDORES, así como intercambiar información exclusivamente relacionada con dichas Facturas.
                    </p>
                    <p class=""text-justify"">
                        CLAVES DE ACCESO: Corresponde a un mecanismo de Seguridad de la Información Electrónica, con");
            WriteLiteral(@"stante de factores de autenticación tendentes a verificar la identidad de EL PROVEEDOR y la cualidad de este para realizar las operaciones propias del SISTEMA TUFACTORING. Estos factores de autenticación corresponderán a aquellos establecidos como Factor de autenticación categorías 2 y 3 de acuerdo a la Resolución Nº 641.10 emanada de la Superintendencia de las Instituciones del Sector Bancario (SUDEBAN) contentiva de las “Normas que Regulan el Uso de los Servicios de la Banca Electrónica”, publicada en la Gaceta Oficial de la República Bolivariana de Venezuela Nº 39.597 de fecha 19 de enero de 2011.
                    </p>
                    <p class=""text-justify"">
                        DÍAS HÁBILES BANCARIOS: Corresponde a los días comprendidos entre lunes y viernes que, conforme al calendario bancario, sean laborables para los bancos.
