                    </p>
                    <p class=""text-justify"">
                        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(VNXTD)<br />
                        D=  _________ND<br />
                        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(360)
                    </p>
                    <p class=""text-justify"">
                        Donde ""D"" significa Descuento, ""VN"" significa Valor Neto, ""TD"" significa Tasa de Descuento; ""ND"" significa el número de días que resulte de sumar los días naturales desde e inclusive la fecha en que se entregue al Proveedor el Precio de venta, respecto de un Derecho Adquirido, hasta inclusive l");
            WriteLiteral(@"a fecha de vencimiento de dicho derecho de Crédito.
                    </p>
                    <p class=""text-justify"">
