                    </p>
                    <p class=""text-justify"">
                        GASTO POR SERVICIO: Corresponde al monto que obtendrá LA INSTITUCION con ocasión a la operación efectiva de la venta de Factura a El INVERSIONISTA o LA INSTITUCION. Este monto corresponderá al resultado de la fórmula aplicable sobre el valor de cada Factura, que será descontado del precio de venta que recibirá EL PROVEEDOR. Este valor puede ser consultado en la página del Sistema.
                    </p>
