                    </p>
                    <p class=""text-justify"">
     ");
            WriteLiteral(@"                   TASA DE DESCUENTO: Corresponde a la tasa aceptada por EL PROVEEDOR para determinar el Descuento, la cual es ofertada por EL INVERSIONISTA o LA INSTITUCION durante el horario en que este activo el Mercado Electrónico y para cada operación de venta que realicen al amparo de este contrato. El cálculo del Descuento se realizará desde la fecha en que se efectúe el anticipo de fondos, hasta la fecha del vencimiento de la Factura.
                    </p>
                    <p class=""text-justify"">
