            WriteLiteral(@" para que EL CLIENTE previo al cargo en sus cuentas y través de LA INSTITUCION, le pague directamente al EL INVERSIONISTA que haya adquirido las Facturas, o a LA INSTITUCION en los términos de este contrato.
                    </p>
                    <p class=""text-justify"">
